import React, { Fragment } from "react";
import { Menu } from "antd";
import "./style.css";

export default (props) => {
    const {menuData} = props;
  return (
    <Fragment>
      <div className="head">
        <Menu mode="horizontal" defaultSelectedKeys={['1']}>
          {
              menuData.map
          }
        </Menu>
      </div>
    </Fragment>
  );
};
